    "INSERT INTO `__PREFIX__dramas_reseller` VALUES (null, __SITEID__, 7, ' de medalla de plata', 'https://img.nymaite.com/chat/20230515/3722a5abfe39e847b19beb1d1a41164d.png', '{\"1\":\"1. Solicitar ser un distribuidor para realizar actividades de promoción empresarial y recibir comisiones de acuerdo con el nivel de distribuidor.\",\"2\":\"2. Después de ascender a distribuidor, si se desea ascender más, se debe comprar nuevamente al precio completo.\",\"3\":\"3. Si los usuarios subordinados que se promocionaron también solicitan convertirse en distribuidores y su nivel es igual o superior al propio, no se podrán recibir comisiones. Para poder recibir comisiones, se debe ascender de nivel.\",\"4\":\"4. Si el nivel del distribuidor propio y el de los subordinados son iguales, se recibirá una bonificación del 5% por estar en el mismo nivel.\",\"5\":\"5. No se podrán realizar reembolsos después de la recarga de productos virtuales.\"}', '0.01', 99.00, 1, 10.00, 5.00, 2592000, 4, 'normal', 1701791505, 1684889459, NULL);",
    "INSERT INTO `__PREFIX__dramas_reseller` VALUES (null, __SITEID__, 7, 'Distribuidor de medalla ', 'https://img.nymaite.com/chat/20230515/3722a5abfe39e847b19beb1d1a41164d.png', '{\"1\":\"1. Solicitar ser un distribuidor para realizar actividades de promoción empresarial y recibir comisiones de acuerdo con el nivel de distribuidor.\",\"2\":\"2. Después de ascender a distribuidor, si se desea ascender más, se debe comprar nuevamente al precio completo.\",\"3\":\"3. Si los usuarios subordinados que se promocionaron también solicitan convertirse en distribuidores y su nivel es igual o superior al propio, no se podrán recibir comisiones. Para poder recibir comisiones, se debe ascender de nivel.\",\"4\":\"4. Si el nivel del distribuidor propio y el de los subordinados son iguales, se recibirá una bonificación del 5% por estar en el mismo nivel.\",\"5\":\"5. No se podrán realizar reembolsos después de la recarga de productos virtuales.\"}', '0.01', 299.00, 2, 20.00, 10.00, 31536000, 3, 'normal', 1686386566, 1684891042, NULL);",
    "INSERT INTO `__PREFIX__dramas_reseller` VALUES (null, __SITEID__, 7, 'plata Distribuidor', 'https://img.nymaite.com/chat/20230515/3722a5abfe39e847b19beb1d1a41164d.png', '{\"1\":\"1. Solicitar ser un distribuidor para realizar actividades de promoción empresarial y recibir comisiones de acuerdo con el nivel de distribuidor.\",\"2\":\"2. Después de ascender a distribuidor, si se desea ascender más, se debe comprar nuevamente al precio completo.\",\"3\":\"3. Si los usuarios subordinados que se promocionaron también solicitan convertirse en distribuidores y su nivel es igual o superior al propio, no se podrán recibir comisiones. Para poder recibir comisiones, se debe ascender de nivel.\",\"4\":\"4. Si el nivel del distribuidor propio y el de los subordinados son iguales, se recibirá una bonificación del 5% por estar en el mismo nivel.\",\"5\":\"5. No se podrán realizar reembolsos después de la recarga de productos virtuales.\"}', '199', 399.00, 3, 30.00, 15.00, 0, 2, 'normal', 1686386607, 1684892683, NULL);",
    "INSERT INTO `__PREFIX__dramas_reseller` VALUES (null, __SITEID__, 8, 'تاجر موزع الميدالية البرونزية', 'https://img.nymaite.com/chat/20230515/3722a5abfe39e847b19beb1d1a41164d.png', '{\"1\":\"1. طلب أن تصبح وكيل توزيع لتعزيز الأعمال التجارية، حيث يتم توزيع العمولة الترويجية وفقًا لمستوى الوكيل التوزيع الخاص به.\",\"2\":\"2. بعد الترقية إلى الوكيل التوزيع، إذا كنت ترغب في الترقية، فسيتعين عليك شراء المنتج مرة أخرى بالسعر الكامل.\",\"3\":\"3. إذا كان المستخدمون الفرعيون الذين قمت بترويجهم يقدمون طلبًا لتصبح وكلاء توزيع وكانت درجة الوكيل الفرعي الخاص بهم تفوقك أو متساوية، فلن تتمتع بالعمولة. إذا كنت ترغب في تلقي العمولة، ستحتاج إلى الترقية.\",\"4\":\"4. إذا كانت درجة الوكيل التوزيع الخاصة بك متساوية مع الوكلاء الفرعيين، فستحصل على 5٪ من المكافأة المستوى.\",\"5\":\"5. لا يمكن استرداد المبالغ المدفوعة بعد شحن المنتجات الافتراضية.\"}', '0.01', 99.00, 1, 10.00, 5.00, 2592000, 4, 'normal', 1701791554, 1684889459, NULL);",
