    "INSERT INTO `__PREFIX__dramas_reseller` VALUES (null, __SITEID__, 9, 'Nhà phân phối huy chương đồng', 'https://img.nymaite.com/chat/20230515/3722a5abfe39e847b19beb1d1a41164d.png', '{\"1\":\"1. Xin vui lòng cho biết để trở thành nhà phân phối và thực hiện việc quảng bá kinh doanh, hoa hồng quảng cáo sẽ được chia sẻ dựa trên cấp độ của nhà phân phối.\",\"2\":\"2. Sau khi thăng cấp thành nhà phân phối, nếu muốn thăng cấp thêm, bạn sẽ phải mua lại với giá đầy đủ.\",\"3\":\"3. Nếu các người dùng cấp dưới mà bạn giới thiệu cũng đăng ký trở thành nhà phân phối và cấp độ của họ cao hơn hoặc bằng cấp độ của bạn, bạn sẽ không được hưởng hoa hồng. Để được hưởng hoa hồng, bạn sẽ cần phải thăng cấp.\",\"4\":\"4. Nếu cấp độ của bạn và cấp độ của người cấp dưới là như nhau, bạn sẽ được hưởng 5% phần thưởng cùng cấp.\",\"5\":\"5. Sau khi nạp tiền cho hàng hóa ảo, không thể hoàn trả được.\"}', '0.01', 99.00, 1, 10.00, 5.00, 2592000, 4, 'normal', 1701791588, 1684889459, NULL);",
